 viendo, en Colecciones de shopping o en la actividad que has realizado con la sesin iniciada en YouTube, entre la que se incluyen los productos que has buscado, productos mencionados en vdeos o productos relacionados. ","textColor":4294967295},{"text":"Ms informacin","navigationEndpoint":{"clickTrackingParams":"CK0CEMdVIhMImrCCgJn8jAMViFlIAB0UhDkj","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nLa informacin y los precios finales de los productos proceden de los comercios y pueden cambiar. Es posible que se te cobren costes adicionales, como los de envo y gestin, que pueden variar. Haz clic en los productos abajo o visita la tienda del comercio para obtener ms informacin (por ejemplo, la disponibilidad del producto o el precio final que te cobrar el comercio) y para hacer una compra. Los precios incluyen el IVA, si corresponde.\n\nLos productos marcados como \"exclusivos del canal\" son aquellos que un comercio ha compartido de forma exclusiva con un canal de YouTube concreto. Estos productos tienen un descuento y/o estn disponibles por un tiempo limitado, y estn sujetos a los trminos y condiciones del comercio. El comercio determina el precio final y las condiciones de compra, y es responsable de ellos. ","textColor":4294967295},{"text":"Ms informacin","navigationEndpoint":{"clickTrackingParams":"CK0CEMdVIhMImrCCgJn8jAMViFlIAB0UhDkj","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nYouTube no se hace responsable de los productos de los comercios ni de la informacin que esto
